import React from 'react';
import { useParams } from 'react-router-dom';

const ProductPage = () => {
  const { silhouette, color, vendorCode } = useParams();

  return (
    <div>
      <h2>Product Page</h2>
      <p>Silhouette: {silhouette}</p>
      <p>Color: {color}</p>
      <p>Vendor Code: {vendorCode}</p>
    </div>
  );
};

export default ProductPage;
